INSERT INTO `notification` VALUES (1,'SMSA01','COLLECTION NOTE (1)\r\nHi #{DNM}#, this is a collection note on behalf of FleetOps and Vantage Ghana Ltd. Please log into http://fleetopsgh.com/driver - Enter your vehicle number and use the mobile number that has your active wallet account to make payment.\r\nThank you – FOVCollector2.1'),(2,'SMSA02','COLLECTION NOTE (2) – REMINDER\r\nHi #{DNM}#, Please log into http://fleetopsgh.com/driver - Enter your vehicle number and use the mobile number that has your active wallet account for payment.\r\nThank you – FOVCollector2.1'),(3,'SMSA03','COLLECTION NOTE (3) – WARNING\r\nHi #{DNM}#, we have sent you two reminders already, but have still not received payment from you. To avoid any inconveniences please make payment now.\r\nPlease log into http://fleetopsgh.com/driver - Enter your vehicle number and use the mobile number that has your active wallet account for payment.\r\nThank you – FOVCollector2.1'),(4,'SMSA04','VEHICLE BLOCKED\r\nHi #{DNM}#, per agreement with your Car-Owner we have been compelled to take the necessary actions to ensure you make payments. Your Car-Owner has been notified of this situation and has been advised to take the necessary actions. Make payments immediately to restore service. Please log into http://fleetopsgh.com/driver, enter your vehicle number and use the mobile number that has your active wallet account for payment. Tampering with the vehicle and or any installed devices shall attract a hefty fine, including and not limited, to time in jail or prison in accordance to the laws of the Republic of Ghana.\r\nThank you – FOVCollector2.1'),(5,'SMSA05','DRIVER DEFAULT - ALERT\r\nHi #{CZN}#, we wish to bring to your attention that your driver #{DNM}# using vehicle number #{VNO}# has failed to make payments as agreed. We have activated our enforcement mechanisms to ensure payment is done accordingly. We advice that you contact your driver to comply or else please take the necessary actions to safeguard your asset (vehicle) from abuse and inappropriate tampering.\r\nThank you – FOVCollector2.1'),(6,'SMSB06','Message Sent by Cash collection service provider.'),(7,'SMSB07','RECEIPT\r\nHi, an amount of #{RMT}# has been received by FleetOps and Vantage Ghana Ltd.\r\nThank you – FOVCollector2.1'),(8,'SMSC08','INCOMPLETE SALES DECLARED - ALERT\r\nHi #{CZN}#, upon our investigation, we wish to bring to your attention that your driver #{DNM}# using vehicle number #{VNO}# has failed to fully declare sales for work done as per your agreement with him/her. If this persists, we shall activate our enforcement mechanisms to compel your driver to render sales fully. We advice that you contact your driver to comply or else please take the necessary actions to safeguard your asset (vehicle) from abuse and inappropriate tampering.\r\nThank you – FOVCollector2.1'),(9,'SMSD09','RIDE HAILING OPERATIONS\r\nHi #{CZN}#, please be informed that upon declaration of sales, your driver #{DNM}# using vehicle number #{VNO}# has consumed #{FTP}# litres of fuel and has incurred GHC#{CWI}# of waste which is potential revenue lost due to the use of your vehicle for activities other than for Ride-hailing revenue generation.\r\nThank you – FOVCollector2.1'),(10,'SMSD10','RH - OPERATIONS TEAM\r\nHi #{DNM}#, please be informed that upon declaration of sales, you have consumed #{FTP}# litres of fuel and have incurred GHC#{CWI}# of waste which is potential revenue lost due to the use of your vehicle for activities other than for Ride-hailing revenue generation. We entreat you to minimize losses by using the car for revenue generation purposes only as agreed with the car owner.\r\nThank you – FOVCollector2.1'),(11,'SMSE11','RIDE HAILING OPERATIONS\r\nHi #{CZN}#, please be informed that your driver #{DNM}# using vehicle number #{VNO}# has stated that he is unable to retrieve sales information from the Ride-Hailing App in use. Accordingly, we have taken steps to investigate the issue and have managed to derive the amount of GHC#{CWI}# due for payment. Also, the driver consumed #{FTP}# litres of fuel.\r\nThank you – FOVCollector2.1');
/*!40000 ALTER TABLE `notification` ENABLE KEYS */;
